import React from 'react';
import './aboutus.scss';


export default function AboutUs() {
  return (
    <div className="aboutus" id="works">
      <div className="wrapper"></div>
        <h1>Despre Noi</h1>
        <h3>Ne ocupam cu producerea de garduri</h3>
        <h3>Balustrade si grilaje</h3>
    </div>
  )
}
